import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Courses(props) {
	return (
		<>
			<Container fluid>
				<Row>
					<Col>
						<SearchBar />
					</Col>
					<Col>2 of 2</Col>
				</Row>
				<Row>
					<Col>
						<CourseCard />
					</Col>
				</Row>
			</Container>
		</>
	);
}

export default Courses;
